function RoomInformationCard(props) {
// Komponenten tar emot props.
    
    function handleCheckedChange(e) {
    // Funktionen tar emot ett event.
    
      let updatedCheckedRooms = [...checked];
      if (e.target.checked) {
        updatedCheckedRooms = [...checked, RoomInformationCard, e.target.value];
      } else {
        updatedCheckedRooms.splice(checked.indexOf(e.target.value), 1);
      }
      props.setChecked
    }
  return (

    <div className="RoomInformationCard">
        <div key={props.id}>
            <ol>
                <li>
                    <ul>
                        <li>{props.rooms[0].roomName}</li>
                        <li>Room for {props.rooms[0].guests} guest(s)</li>
                        <label>Choose room <input type="checkbox" onClick={() => props.chooseRoom(props.rooms[0].roomID)}/></label>
                    </ul>
                </li>

                <li>
                    <ul>
                        <li>{props.rooms[1].roomName}</li>
                        <li>Room for {props.rooms[1].guests} guests</li>
                        <label>Choose room <input type="checkbox" onClick={() => props.chooseRoom(props.rooms[1].roomID)}/></label>
                    </ul>
                </li>

                <li>
                    <ul>
                        <li>{props.rooms[2].roomName}</li>
                        <li>Room for {props.rooms[2].guests} guests</li>
                        <label>Choose room <input type="checkbox" onClick={() => props.chooseRoom(props.rooms[2].roomID)}/></label>
                    </ul>
                </li>
            </ol>
        </div>
    </div>
  )
}

export default RoomInformationCard;
